@YandyDiaz115084 La montée de #Trump est aussi fulgurante que jadis la montée d'#Hitler.
Cependant, les visions d'#Hitler sont complètement différentes de celles de #Trump et de tenter de les comparer en tant que leader fait partie des amalgames douteux et amères. 
D'ailleurs, Normand devrait
